import React from 'react';
import 'tachyons';


const Card = ({ id, name, username, email }) => {
  return (
    <div className='tc bg-light-red dib br3 pa3 ma2 grow bw2 shadow-5'>
      <img src={`https://robohash.org/${id}?500x500`} alt="robots"/>
      <div>
        <h2>{ name }</h2>
        <p>{ email }</p>
      </div>
    </div>
  );
}

export default Card;
